(164,'A changer','POISSONS DE CAPBRETON (Le GAVROCHE) - Commande de Novembre 2025','2025-10-23 16:45:25','2025-11-20 00:00:00',198,'Avec le fileyeur  Le Gavroche  de Capbreton, voici au catalogues son offre habituelle de pochettes \"surprise\", dont le contenu dpend de la pche du jour. Les pochettes, psent 2 ou 3 kg, sont proposes au tarif de 10  le kilo, auxquels sajoutent 2  de frais de port, soit un total de 22  ou 32  selon le poids. Lassortiment varie en fonction des poissons disponibles selon la saison et les prises.\r\nPrcisons que la commande ne pourra tre passe que si au moins 8 pochettes sont rserves, afin dassurer la rentabilit pour Gavroche. \r\nLes livraisons, difficiles  planifier longtemps  lavance en raison de la mto ou des alas de la pche, auront lieu uniquement pendant les jours douverture de lpicerie : le mardi, le jeudi aprs-midi ou le samedi matin. Cela permet de garantir la fracheur du poisson. Vous serez informs rgulirement via le groupe signal  CoopAz gnral , veillez donc  tre disponibles pour venir rcuprer (ou faire rcuprer) votre commande  la date indique.\r\n',3,'2025-11-22',1,0,NULL,NULL),
